import React from 'react';
import './Results.css';

const Results = () => {
    return (
        <div className="results">
            <h3>Resultados</h3>
            <p>Aquí se mostrarán los resultados del análisis de los instrumentos musicales.</p>
        </div>
    );
};

export default Results;
